function F = f_evolution_int(y, Dy, H1, H2, m2, m3, s1, s2, Q)

    h1 = H1 + y{1};
    h2 = H2 + y{2};

    num1 = (h1 .^ 2) .* (((m3 .^ 2 .* (m2 - 1) .* h1 .^ 4) ./ 0.3e1 + m3 .* (m2 - 0.4e1 ./ 0.3e1) .* ((m2 - m3) .* h2 - m2) .* (h1 .^ 3) - (m3 .* (m2 - 2) .* ((m2 - m3) .* h2 .^ 2 - m2) .* h1 .^ 2) + (m3 .* (m2 - 4) .* ((m2 - m3) .* h2 .^ 3 - m2) .* h1) ./ 0.3e1 - ((m2 - m3) .^ 2 .* h2 .^ 4) ./ 0.3e1 + 0.4e1 ./ 0.3e1 .* m2 .* (m2 - m3) .* (h2 .^ 3) - (2 .* m2 .* (m2 - m3) .* h2 .^ 2) + 0.4e1 ./ 0.3e1 .* m2 .* (m2 - m3) .* h2 - (m2 .^ 2) ./ 0.3e1) .* h1 .* s1 .* Dy{3,1} + (s2 .* ((m3 .* (m2 - 1) .* h1 .^ 3) - (m3 .* (h2 + 2) .* (m2 - 1) .* h1 .^ 2) ./ 0.3e1 + ((m2 ./ 0.3e1 - m3 ./ 0.3e1) .* (h2 .^ 2) + (-0.2e1 ./ 0.3e1 .* m2 + 0.4e1 ./ 0.3e1 .* m3) .* h2 + m2 ./ 0.3e1) .* h1 - (h2 .* ((m2 - m3) .* h2 .^ 2 + (-2 .* m2 + 2 .* m3) .* h2 + m2))) .* ((h2 - 1) .^ 2) .* Dy{3,2} ./ 0.2e1 + (m3 .* Q .* (m3 .* (m2 - 1) .* h1 .^ 2 + ((2 .* m2 - 2 .* m3) .* h2 - 2 .* m2) .* h1 + (-3 .* m2 + 3 .* m3) .* h2 .^ 2 + 3 .* m2))) .* m2);
    num2 = 0.3e1 .* (s2 .* ((m3 .* (m2 - 1) .^ 2 .* h1 .^ 4) - ((m2 - 1) .* ((m2 - 4 .* m3) .* h2 - m2) .* h1 .^ 3) + (3 .* h2 .* (m2 - 1) .* ((m2 - 2 .* m3) .* h2 - m2) .* h1 .^ 2) - 0.3e1 .* (h2 .^ 2) .* ((m2 - 0.4e1 ./ 0.3e1 .* m3) .* h2 - m2) .* (m2 - 1) .* h1 - (h2 .^ 3 .* ((m2 - m3) .* h2 - m2))) .* (h2 - 1) .* Dy{3,2} ./ 0.9e1 + m2 .* ((h1 .^ 2) .* s1 .* ((m3 .* (m2 - 1) .* h1 .^ 3) - (m3 .* (h2 + 2) .* (m2 - 1) .* h1 .^ 2) ./ 0.3e1 + ((m2 ./ 0.3e1 - m3 ./ 0.3e1) .* (h2 .^ 2) + (-0.2e1 ./ 0.3e1 .* m2 + 0.4e1 ./ 0.3e1 .* m3) .* h2 + m2 ./ 0.3e1) .* h1 - (h2 .* ((m2 - m3) .* h2 .^ 2 + (-2 .* m2 + 2 .* m3) .* h2 + m2))) .* Dy{3,1} ./ 0.6e1 + Q .* ((m3 .* (m2 - 1) .* h1 .^ 2) - 0.2e1 ./ 0.3e1 .* m3 .* (h2 + 2) .* (m2 - 1) .* h1 + (m3 ./ 0.3e1 - m2 ./ 0.3e1) .* (h2 .^ 2) + (-0.4e1 ./ 0.3e1 .* m3 + 0.2e1 ./ 0.3e1 .* m2) .* h2 - m2 ./ 0.3e1))) .* ((h2 - 1) .^ 2);
    denom = m3 .^ 2 .* (m2 - 1) .^ 2 .* h1 .^ 4 - 4 .* m3 .* (m2 - 1) .* ((m2 - m3) .* h2 - m2) .* h1 .^ 3 + 6 .* ((m2 - m3) .* h2 .^ 2 - m2) .* m3 .* (m2 - 1) .* h1 .^ 2 - 4 .* m3 .* (m2 - 1) .* ((m2 - m3) .* h2 .^ 3 - m2) .* h1 + (m2 - m3) .^ 2 .* h2 .^ 4 - 4 .* m2 .* (m2 - m3) .* h2 .^ 3 + 6 .* m2 .* (m2 - m3) .* h2 .^ 2 - 4 .* m2 .* (m2 - m3) .* h2 + m2 .^ 2;

    F = [num1 ./ denom; num2 ./ denom];

end
